import React from 'react';
import {useState} from 'react';
import { NavLink } from 'react-router-dom';
import shopBag from './../images/shop-bag.svg';
import './../styles/Navbar.css';
import './../styles/Cartcontainer.css';
import Home from './Home';


const Navbar = () => {

    const [show, setShow] = useState(false);
    return (

        <div>
            <div className="Nav-bar" >
                <div className="Logo">
                    <h2 className="Logo-text">Shopi</h2>
                </div>
                <div className="Cart-section">
                    <NavLink className="navbar-item" activeClassName="is-active" to="/">
                        Home
                    </NavLink>

                    <NavLink className="navbar-item" activeClassName="is-active" pat="/cart" onClick={() => setShow(!show)}>
                        <img className="Cart-img" src={shopBag} alt="bagImage" />
                        Cart
                    </NavLink>

                    {/* <h3 className="Cart-text" onClick={showCart}>Cart</h3> */}
                </div>
            </div>

            <Overlay  show={show} placement="right">
                <div id="mySidenav" class="sidenav" onLoad={setTimeout(closeNav,4000)}>
                <span id="close" className="closeIcon" onClick={closeNav}>&times;</span>
                <div className="side-nav">
                    <a href="#">About</a>
                    <a href="#">Services</a>
                    <a href="#">Clients</a>
                    <a href="#">Contact</a>
                </div>
                </div>
            </Overlay>
        </div>

    )
    function closeNav() {
        document.getElementById("mySidenav").style.width = "0";
    }

}

export default Navbar;
